import React from 'react';
import { Carousel } from 'react-bootstrap';
import image1 from './images/i2.jpeg';
import image2 from './images/i3.jpeg';
import image3 from './images/i4.jpeg';
import Nav from './Nav.js';
const Ab = () => {
  return (
    <>
    <Nav/>
      <Carousel style={{ height: "100vh" }}>
        <Carousel.Item interval={1000}>
          <img
            className="d-block w-100"
            src={image1}
            alt="First slide image"
            style={{ height: "80vh" }}
          />
          <Carousel.Caption>
            <h3>WeL Come To Chitwan</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item interval={500}>
          <img
            className="d-block w-100"
            src={image2}
            alt="Second slide image"
            style={{ height: "80vh" }}
          />
          <Carousel.Caption>
            <h3>Elephant Riding</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={image3}
            alt="Third slide image"
            style={{ height: "80vh" }}
          />
          <Carousel.Caption>
            <h3>Rapti Sunset View </h3>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </>
  );
}

export default Ab;
